const TeacherDetails = ({ teacher }) => {
    return (
        <div className="teacher-details">
            <p>Name: {teacher.name}</p>
            <p>Email: {teacher.email}</p>
            <p>Subject: {teacher.teachSubject}</p>
            <p>Classes: {teacher.teachSclass}</p>
        </div>
    )
}

export default TeacherDetails
